import React from "react";
import { Input } from "antd";
import { useHistory } from "react-router-dom";
import Search from '../common/search';
import "./home.scss";



function Home() {


  return (
    <div className="home">
      <Search
        className="inner-search"
        enterButton="Search"
        placeholder="Search for a movie, tv show, ..."
        onSearch={onSearch}
        size="large"
      />
    </div>
  );
}

export default Home;
